  title: { rendered: "The Beauties of Gullfoss" },
  content: {
    rendered:
      '<p>Gullfos is a waterfall located in the canyon of the Hvítá river, in southwest Iceland.<!--more--></p>\n<p><a href="https://en.wikipedia.org/wiki/Gullfoss" target="_blank" rel="noopener noreferrer">Gullfoss</a> is one of the most popular tourist attractions in Iceland. The wide Hvítá rushes southward, and about a kilometre above the falls it turns sharply to the right and flows down into a wide curved three-step &#8220;staircase&#8221; and then abruptly plunges in two stages (11 metres or 36 feet, and 21 metres or 69 feet) into a crevice 32 metres (105 ft) deep. The crevice, about 20 metres (66 ft) wide and 2.5 kilometres (1.6 mi) in length, extends perpendicular to the flow of the river. The average amount of water running down the waterfall is 140 cubic metres (4,900 cu ft) per second in the summer and 80 cubic metres (2,800 cu ft) per second in the winter. The <a href="/sample-page/">highest flood</a> measured was 2,000 cubic metres (71,000 cu ft) per second.</p>\n<h3>An iconic waterfall of Iceland</h3>\n<figure id="attachment_70" aria-describedby="caption-attachment-70" style="width: 840px" class="wp-caption alignnone"><a href="http://test.frontity.org/2016/the-beauties-of-gullfoss/gullfoss/"><img class="wp-image-70" src="https://i1.wp.com/test.frontity.org/wp-content/uploads/2016/11/Gullfoss.jpg?resize=840%2C473" alt="gullfoss" width="840" height="473" srcset="https://i1.wp.com/test.frontity.org/wp-content/uploads/2016/11/Gullfoss.jpg?resize=1024%2C577&amp;ssl=1 1024w, https://i1.wp.com/test.frontity.org/wp-content/uploads/2016/11/Gullfoss.jpg?resize=300%2C169&amp;ssl=1 300w, https://i1.wp.com/test.frontity.org/wp-content/uploads/2016/11/Gullfoss.jpg?resize=768%2C433&amp;ssl=1 768w, https://i1.wp.com/test.frontity.org/wp-content/uploads/2016/11/Gullfoss.jpg?resize=1200%2C676&amp;ssl=1 1200w, https://i1.wp.com/test.frontity.org/wp-content/uploads/2016/11/Gullfoss.jpg?w=2000&amp;ssl=1 2000w, https://i1.wp.com/test.frontity.org/wp-content/uploads/2016/11/Gullfoss.jpg?w=1680 1680w" sizes="(max-width: 709px) 85vw, (max-width: 909px) 67vw, (max-width: 1362px) 62vw, 840px" data-recalc-dims="1" /></a><figcaption id="caption-attachment-70" class="wp-caption-text">Gullfoss, an iconic waterfall of Iceland.</figcaption></figure>\n<div class="4">During the first half of the 20th century and some years into the late 20th century, there was much speculation about using Gullfoss to generate electricity. During this period, the waterfall was rented indirectly by its owners, Tómas Tómasson and Halldór Halldórsson, to foreign investors. However, the investors&#8217; attempts were unsuccessful, partly due to lack of money. The waterfall was later sold to the state of Iceland, and is now protected.</div>\n<blockquote>\n<p style="text-align: left;">Iceland is not a destination. It’s an adventure set in stunning scenery.</p>\n</blockquote>\n<p>Sigríður Tómasdóttir, the daughter of Tómas Tómasson, was determined to preserve the waterfall&#8217;s condition and even threatened to throw herself down. Although it is widely believed, the very popular story that Sigríður saved the waterfall from exploitation is untrue. <a href="http://www.nat.is/travelguideeng/gullfoss_sigridur_tomasdottir.htm" target="_blank" rel="noopener noreferrer">A stone memorial to Sigriður</a>, located above the falls, depicts her profile.</p>\n<p>Source: <a href="https://en.wikipedia.org/wiki/Gullfoss">Gullfoss</a>.<br />\nCategory: <a href="/category/travel/">Travel</a></p>\n',
    protected: false
  },
